import * as FaIcons from "react-icons/fa";

export const SidebarData=[
    {
        title: "Home",
        path: "/",
        icon: <FaIcons.FaHome />,
      },
      {
        title: "Git",
        path: "/git",
        icon: <FaIcons.FaGit />,
      },
      {
        title: "CSS",
        path: "/css",
        icon: <FaIcons.FaCss3Alt />,
      },
      {
        title: "Php",
        path: "/php",
        icon: <FaIcons.FaPhp />,
      },
      {
        title: "Java",
        path: "/java",
        icon: <FaIcons.FaJava />,
      },
     
      {
        title: "Node",
        path: "/node",
        icon: <FaIcons.FaNodeJs />,
      },
      {
        title: "Figma",
        path: "/figma",
        icon: <FaIcons.FaFigma />,
      },
      {
        title: "Angular",
        path: "/angular",
        icon: <FaIcons.FaAngular />,
        
      },
      {
        title: "React",
        path: "/react",
        icon: <FaIcons. FaReact />,
       
      },
]
